#include <stdio.h>
#include <stdlib.h>

#define N 11
#define M 11
#define K 6
#define S 1000006

int max(int a, int b) {
    return a > b ? a : b;
}

int min(int a, int b) {
    return a < b ? a : b;
}

int dp[N][M][K + 1];

int main() {
    int n, m, k, s;
    scanf("%d %d %d %d", &n, &m, &k, &s);

    int a[N][M];
    for (int i = 0; i < n; i++) {
        for (int j = 0; j < m; j++) {
            scanf("%d", &a[i][j]);
        }
    }

    for (int i = 0; i < n; i++) {
        for (int j = 0; j < m; j++) {
            for (int p = 0; p <= k; p++) {
                dp[i][j][p] = -1;
            }
        }
    }

    dp[0][0][0] = 0;

    for (int i = 0; i < n; i++) {
        for (int j = 0; j < m; j++) {
            for (int p = 0; p <= k; p++) {
                if (dp[i][j][p] == -1) continue;
                int sum = 0;
                for (int x = j; x < m; x++) {
                    sum += a[i][x];
                    if (sum > s) break;
                    for (int q = 0; q <= k; q++) {
                        if (dp[i][x][q] == -1) {
                            dp[i][x][q] = dp[i][j][p] + 1;
                        } else {
                            dp[i][x][q] = min(dp[i][x][q], dp[i][j][p] + 1);
                        }
                    }
                }
                sum = 0;
                for (int x = i; x < n; x++) {
                    sum += a[x][j];
                    if (sum > s) break;
                    for (int q = 0; q <= k; q++) {
                        if (dp[x][j][q] == -1) {
                            dp[x][j][q] = dp[i][j][p] + 1;
                        } else {
                            dp[x][j][q] = min(dp[x][j][q], dp[i][j][p] + 1);
                        }
                    }
                }
            }
        }
    }

    int ans = 1;
    for (int i = 0; i < n; i++) {
        for (int j = 0; j < m; j++) {
            for (int p = 0; p <= k; p++) {
                if (dp[i][j][p] != -1 && dp[i][j][p] <= k - p) {
                    ans = 0;
                }
            }
        }
    }

    printf("%s\n", ans ? "Yes" : "No");

    return 0;
}
